import s from './catalog.module.css';
import BookElem from './../BookCatalogPage/BookElem/bookElem.jsx';
import FilmElem from './../FilmCatalogPage/FilmElem/filmElem.jsx';

const CatalogPage = (props) =>{

  let elems = []
  switch (props.elem_name) {
    case 'book':{
      elems = props.elemsList.books.map((elem)=>{
        return (<BookElem info={elem}/>)
      });
    }
    case 'film':{
      elems = props.elemsList.films.map((elem)=>{
        return (<FilmElem info={elem}/>)
      });
    }
    default:
      return
  }

  return (
    <div className={s.catalogPage}>
      <div className={s.searchline}>
        <input type="text" />
        <button>Search</button>
      </div>
      <div className={s.elemList}>
        {elems}
      </div>
    </div>
  );
}

export default CatalogPage;
